// src/pages/LoginPage.js
import React, { useState } from 'react';
import { Form, Button, Container, Modal} from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import RegistrationModal from '../components/RegistrationModal';

const LoginPage = () => {
  const navigate = useNavigate();

  const [show, setShow] = useState(false);

  const handleRegisterClick = () => {
  setShow(true);
  console.log('Modal should open', show);  // This will still show the previous state due to batching
};

  const handleClose = () => {
    setShow(false);
  };

  return (
    <Container className="d-flex flex-column align-items-center my-5">
      <h2>Login</h2>
      <Form className="w-50">
        <Form.Group controlId="formEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control type="email" placeholder="Enter email" />
        </Form.Group>
        <Form.Group controlId="formPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>
        <Button variant="primary" type="submit" className="my-3">
          Register
        </Button>
        <div className="text-center my-3">OR</div>
        <Button variant="secondary" className="mb-3" onClick={handleRegisterClick}>
          Create a new account
        </Button>
            {/* <RegistrationModal show={show} onHide={handleClose} /> */}

        <Modal show={show} onHide={handleClose} animation={false}>
        <Modal.Header closeButton>
        <Modal.Title>Get Started With ReAlign!</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form>
          <Form.Group controlId="formFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control type="text" placeholder="Enter first name" />
          </Form.Group>
          <Form.Group controlId="formLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control type="text" placeholder="Enter last name" />
          </Form.Group>
          <Form.Group controlId="formPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group controlId="formRepeatPassword">
            <Form.Label>Repeat Password</Form.Label>
            <Form.Control type="password" placeholder="Repeat Password" />
          </Form.Group>
          <Form.Group>
            <Form.Label>Upload Profile</Form.Label>
            <Form.File id="formProfilePic" />
          </Form.Group>
          <Button variant="primary" type="submit" className="mt-3">
            Get Started
          </Button>
        </Form>
      </Modal.Body>
      </Modal>
        <a href="#" className="d-block text-center">Forgot your password?</a>
      </Form>
    </Container>
  );
};

export default LoginPage;
